import Auth from "./pages/Auth";
import Mainer from "./pages/Mainer";
import Server from "./pages/Server";
import Settings from "./pages/Settings";

export const authRoutes = [
    {
        patch: ADMIN_ROUTER,
        Component: Mainer
    },
    {
        patch: BASKET_ROUTER,
        Component: Server
    },
    {
        patch: BASKET_ROUTER,
        Component: Settings
    }
]

export const publicRoutes = [
    {
        patch: LOGIN_ROUTER,
        Component: Auth
    },
    {
        patch: REGISTRATION_ROUTER,
        Component: Auth
    }
]
